{% extends "layout.html" %}

            {% block links %}
                <link rel="stylesheet" href="../static/css/variaveis.css">
                <link rel="stylesheet" href="../static/css/headerOthers.css">
				<link rel="stylesheet" href="../static/css/pedidos.css">
				<link rel="preconnect" href="https://fonts.googleapis.com">
				<link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
				<link href="https://fonts.googleapis.com/css2?family=Lilita+One&family=Roboto:ital,wght@0,100;0,300;0,400;0,500;0,700;0,900;1,100;1,300;1,400;1,500;1,700;1,900&display=swap" rel="stylesheet">
            {% endblock %}

            {% block title %}
                :( Nada por aqui - Rifa EM2
            {% endblock %}

            {% block body %}
				<style>
				
					div#svgContainer {
						position: relative;
						height: 100vh;
						background: #3670B8;
						width: 100%;
					}
					.princ {
						    position: absolute;
							height: 100%;
							width: min(70rem, 70%);
							max-width: 700px;
							max-height: 500px;
							place-self: center;
							align-self: center;
							animation: bgMove 5s 3s ease-in-out infinite;
							z-index: 10;
					}
					header {
						display: none;
					}
					.pedraOne {
						position: absolute;
						height: 100%;
						width: min(60rem, 60%);
						max-width: 600px;
						max-height: 500px;
						place-self: start;
						display: grid;
						align-self: end;
						align-items: end;
						z-index: 5;
					}
					.pedraTwo {
						position: absolute;
						height: 100%;
						width: min(70rem, 60%);
						max-width: 700px;
						max-height: 600px;
						place-self: end;
						display: grid;
						align-self: end;
						align-items: end;
						z-index: 6;
					}
					.peixes {
						position: absolute;
						height: 100%;
						width: min(30rem, 30%);
						max-width: 300px;
						max-height: 300px;
						place-self: start;
						bottom: 10%;
						left: 20%;
						align-self: end;
						z-index: 5;
						animation: fishMove 14s ease-in-out infinite;
					}
					.peixesTwo {
						position: absolute;
						height: 100%;
						width: min(30rem, 30%);
						max-width: 300px;
						max-height: 300px;
						top: 10%;
						right: 10%;
						place-self: end;
						align-self: start;
						z-index: 5;
						animation: upperfishMove 10s ease-in-out infinite;
					}
					.detalhesAgua {
						position: absolute;
						height: 100%;
						width: 100%;
						place-self: center;
						align-self: center;
						opacity: 0.5;
						z-index: 3;
						animation: bgMove 8s ease-in-out infinite;
					}
					.peixesTwo .st0,
					.peixes .st0 {
						opacity: 1;
					}
					.bolhas {
						position: absolute;
						height: 100%;
						width: 100%;
						max-width: 2000px;
						top: -20%;
						place-self: start;
						align-self: start;
						z-index: 1;
						animation: bolhasMove 8s ease-in-out infinite;
					}
					.fundo {
						position: absolute;
						height: 100%;
						width: 100%;
						filter: blur(10px);
						place-self: center;
						align-self: center;
						opacity: .9;
						z-index: 0;
					}
					a {
						position: absolute;
						bottom: 25%;
						left: 25%;
						z-index: 10;
						font-size: 5rem;
						color: #fff;
						text-transform: uppercase;
						border: 2px solid;
						padding: 1rem 3rem;
						font-family: 'Lilita One';
						letter-spacing: 2px;
						border-radius: 1rem;
						cursor: pointer;
						filter: drop-shadow(0px 0px 6px black);
						transition: 0.4s;
					}
					a:hover{
						transform: scale(1.050);
					}
					
					@keyframes bolhasMove {
						0%{
							transform: scale(1) translateY(0%);
						}
						60%{
							transform: scale(1.048) translateY(6%);
						}
						100%{
							transform: scale(1) translateY(0%);
						}
					}
					@keyframes bgMove {
						0%{
							transform: scale(1);
						}
						60%{
							transform: scale(1.048);
						}
						100%{
							transform: scale(1);
						}
					}
					@keyframes fishMove {
						0%{
							bottom: -30%;
							transform: scale(1);
							left: 40%
						}
						10%{
							transform: scale(1.5);
						}
						30%{
							transform: scale(1);
						}
						60%{
							transform: scale(1.6);
						}
						80%{
							transform: scale(1);
						}
						100%{
							bottom: 60%;
							transform: scale(1.5);
							left: -20%
						}
					}
					@keyframes upperfishMove {
						0%{
							top: 50%;
							transform: scale(1);
							right: -15%;
						}
						10%{
							transform: scale(1.2);
						}
						30%{
							transform: scale(1);
						}
						60%{
							transform: scale(1.3);
						}
						80%{
							transform: scale(1);
						}
						100%{
							top: -40%;
							transform: scale(1.2);
							right: 40%;
						}
					}
					@media (max-width: 450px){
						.princ {
							width: min(80rem, 90%);
							max-width: 700px;
							max-height: 400px;
						}
						.pedraOne {
							width: min(80rem, 90%);
							max-width: 700px;
							max-height: 400px;
						}
						.pedraTwo {
							width: min(70rem, 70%);
							max-width: 700px;
							max-height: 400px;
						}
						.bolhas {
							top: 30%;			
						}
					}
					@media (max-width: 320px){
						.princ {
							max-height: 300px;
						}
						.pedraOne {
							width: min(80rem, 100%);
						}
						.pedraTwo {
							width: min(70rem, 91%);
						}
						.fundo {
							height: 0%;
						}
					}
					@media (max-width: 1440px){
						.peixesTwo {
							animation: upperfishMove 14s ease-in-out infinite;
						}
						@keyframes fishMove {
							0%{
								bottom: -50%;
								transform: scale(1);
								left: 60%
							}
							10%{
								transform: scale(1.3);
							}
							30%{
								transform: scale(1);
							}
							60%{
								transform: scale(1.3);
							}
							80%{
								transform: scale(1);
							}
							100%{
								bottom: 70%;
								transform: scale(1.3);
								left: -40%
							}
						}
					}
					@media (max-width: 425px){
						@keyframes fishMove {
							0%{
								bottom: -50%;
								transform: scale(1);
								left: 80%
							}
							10%{
								transform: scale(1.3);
							}
							30%{
								transform: scale(1);
							}
							60%{
								transform: scale(1.3);
							}
							80%{
								transform: scale(1);
							}
							100%{
								bottom: 50%;
								transform: scale(1.3);
								left: -40%
							}
						}
					}
					@media (max-width: 1024px){
						@keyframes upperfishMove {
							0%{
								top: 50%;
								transform: scale(1);
								right: -30%;
							}
							10%{
								transform: scale(1.2);
							}
							30%{
								transform: scale(1);
							}
							60%{
								transform: scale(1.3);
							}
							80%{
								transform: scale(1);
							}
							100%{
								top: -40%;
								transform: scale(1.2);
								right: 80%;
							}
						}
					}
				
				</style>

                    document.addEventListener("DOMContentLoaded", () => {
